function themeResponsiveEmbeds(){var e,t;document.querySelectorAll("iframe").forEach(function(i){i.width&&i.height&&(e=parseFloat(i.width)/parseFloat(i.height),t=parseFloat(window.getComputedStyle(i.parentElement,null).width.replace("px","")),i.style.maxWidth="100%",i.style.maxHeight=Math.round(t/e).toString()+"px")})}themeResponsiveEmbeds(),window.onresize=themeResponsiveEmbeds;